def compare_two_digit(digit1, digit2):
    len_digit1 = len(str(digit1))
    len_digit2 = len(str(digit2))
    str_digit1 = str(digit1)
    str_digit2 = str(digit2)

    if(len_digit1 == len_digit2):
        if digit1 > digit2:
            return True
        else:
            return False
    elif (len_digit1 < len_digit2):
        if int(str_digit2[0:len_digit1]) > int(str_digit1):
            return False
        elif int(str_digit2[0:len_digit1]) < int(str_digit1):
            return True
        else :
            left_side = int(str(digit1) + str(digit2))
            right_side = int(str(digit2) + str(digit1))

            if left_side >= right_side:
                return True
            else:
                return False

    elif (len_digit1 > len_digit2):
        if int(str_digit1[0:len_digit2]) > int(str_digit2):
            return True
        elif int(str_digit1[0:len_digit2]) < int(str_digit2):
            return False
        else :
            left_side = int(str(digit1) + str(digit2))
            right_side = int(str(digit2) + str(digit1))

            if left_side >= right_side:
                return True
            else:
                return False



def solution(numbers):
    answer = ''
    numbers.sort()
    number_list = []
    for index in range(len(numbers)):

        for index2 in range(len(numbers)):
            if(index2 <= index):
                continue
            if(compare_two_digit(numbers[index],numbers[index2])):
                temp_digit = numbers[index]
                numbers[index] = numbers[index2]
                numbers[index2] = temp_digit
    numbers.reverse()
    for index in numbers:
        answer += str(index)

    return str(int(answer))

